import { FETCH_FAVORITES_STREAMS } from './constants';

export function fetchFavoriteStreams(payload) {
  return {
    type: FETCH_FAVORITES_STREAMS,
    payload: payload,
  };
}

export function fetchFavoriteStreamsSuccess() {
  return {
    type: FETCH_FAVORITES_STREAMS_SUCCESS,
  };
}
